import React from "react";
import { Grid, Stack, Typography, Box } from "@mui/material";
import { Container } from "@mui/material";
import Link from "@mui/material/Link";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import { CommonHeader, CommonDes, Separator } from "../styles/theme";
import famImg from "../images/Component 20.png";
import noqa from "../images/why NoQA.png";
import fame1 from "../images/Frame 38553 1.png";
import { CardHeader, CardDes } from "../styles/products";

export default function Promotions() {
  return (
    <>
      <Container maxWidth="xl">
        <Separator />
        {/* Damage Protection Plans headers */}
        <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box component="div" className="port-content">
              <CommonHeader className="CommonHeader">
                Why NoQA Warranty?
              </CommonHeader>
            </Box>
          </Grid>
        </Grid>

        {/* image container */}

        <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={8} sm={8} xm={6} lg={8}>
            <Box
              component="div"
              sx={{
                paddingY: "10px",
              }}
            >
              <img src={famImg} alt="family image" width="100%" />
            </Box>
          </Grid>
          <Grid
            item
            md={4}
            sm={4}
            xm={6}
            lg={4}
            sx={{ padding: "10px 0px 0px 0px" }}
          >
            <img src={noqa} alt="family image" className="noqa" width="100%" />
          </Grid>
        </Grid>
      </Container>

      {/* next page */}

      <Container maxWidth="xl" sx={{ backgroundColor: "#F0F0F0" }}>
        <Separator />
        {/* Damage Protection Plans headers */}
        <Grid container sx={{ paddingX: "30px" }}>
          <Grid item md={12} sm={12} xm={12} lg={12}>
            <Box component="div" className="port-content">
              <CommonHeader className="CommonHeader">
                Hassle-free and Convenient claims process.
              </CommonHeader>
            </Box>
          </Grid>
        </Grid>

        {/* Extended Warranty Plans: */}

        <Grid container spacing={3} sx={{ paddingX: "30px" }}>
          <Grid item md={3} sm={6} xm={6} lg={3}>
            <Box
              component="div"
              sx={{
                paddingY: "20px",
              }}
            >
              <Link href="/menulist">
                <Card
                  elevation={3}
                  sx={{
                    boxSizing: "border-box",
                    padding: "0px",
                    borderRadius: "0px",
                    transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                  }}
                  className="zoomer"
                >
                  <CardMedia
                    component="img"
                    height="140"
                    sx={{ padding: "0px", padding: "10px" }}
                    image={fame1}
                    alt="Order Online"
                  />
                  <CardContent>
                  <CardHeader style={{textAlign:"left",color:"#FB0000",fontWeight:400,marginBottom:"20px"}} gutterBottom>STEP 1:</CardHeader>
                    <CardHeader style={{textAlign:"left",marginBottom:"10px"}} gutterBottom>Easy Claim Registration</CardHeader>
                    <CardDes gutterBottom>
                      Notify us via our app or website to register your claim
                      quickly and hassle-free.
                    </CardDes>
                  </CardContent>
                </Card>
              </Link>
            </Box>
          </Grid>
          <Grid item md={3} sm={6} xm={6} lg={3}>
            <Box
              component="div"
              sx={{
                paddingY: "20px",
              }}
            >
              <Link href="/menulist">
                <Card
                  elevation={3}
                  sx={{
                    boxSizing: "border-box",
                    padding: "0px",
                    borderRadius: "0px",
                    transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                  }}
                  className="zoomer"
                >
                  <CardMedia
                    component="img"
                    height="140"
                    sx={{ padding: "0px", marginY: "10px" }}
                    image={noqa}
                    alt="Order Online"
                  />
                  <CardContent>
                    <CardHeader gutterBottom>Television</CardHeader>
                  </CardContent>
                </Card>
              </Link>
            </Box>
          </Grid>
          <Grid item md={3} sm={6} xm={6} lg={3}>
            <Box
              component="div"
              sx={{
                paddingY: "20px",
              }}
            >
              <Link href="/menulist">
                <Card
                  elevation={3}
                  sx={{
                    boxSizing: "border-box",
                    padding: "0px",
                    borderRadius: "0px",
                    transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                  }}
                  className="zoomer"
                >
                  <CardMedia
                    component="img"
                    height="140"
                    sx={{ padding: "0px", marginY: "10px" }}
                    image={noqa}
                    alt="Order Online"
                  />
                  <CardContent>
                    <CardHeader gutterBottom>Television</CardHeader>
                  </CardContent>
                </Card>
              </Link>
            </Box>
          </Grid>
          <Grid item md={3} sm={6} xm={6} lg={3}>
            <Box
              component="div"
              sx={{
                paddingY: "20px",
              }}
            >
              <Link href="/menulist">
                <Card
                  elevation={3}
                  sx={{
                    boxSizing: "border-box",
                    padding: "0px",
                    borderRadius: "0px",
                    transition: "0.5s ease 0s, transform 0.5s ease 0s;",
                  }}
                  className="zoomer"
                >
                  <CardMedia
                    component="img"
                    height="140"
                    sx={{ padding: "0px", marginY: "10px" }}
                    image={noqa}
                    alt="Order Online"
                  />
                  <CardContent>
                    <CardHeader gutterBottom>Television</CardHeader>
                  </CardContent>
                </Card>
              </Link>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </>
  );
}
